import { Grid } from '@mui/material'
import Banner from "./Banner";
import Categories from "./Categories";
import Postes from './Postes';
const Home = () => {
    return(
        <>
        <Banner />
        <Grid container>
            <Grid item lg={2} xs ={12} sm={2}> 
                <Categories/>
            </Grid>
            <Grid container item lg={10} xs = {12} sm={10}>
             <Postes />
            </Grid>
        </Grid>
        </>
    )
}
export default Home;
